/**
  * @brief  Prepares the picture to be Saved in USB.
  * @param  None
  * @retval None
  */
static uint8_t PicturePrepare(void) 
{
  FRESULT res1, res2;     /* FatFs function common result code */
  uint32_t byteswritten;  /* File write count */
	uint32_t address = SRAM_DEVICE_ADDR;
	uint32_t addr0	 = SRAM_DEVICE_ADDR + 0;
	uint32_t addr1   = SRAM_DEVICE_ADDR + 1;
	uint32_t addr2	 = SRAM_DEVICE_ADDR + 2;
  uint16_t x = 0;
  uint16_t y = 0;
  uint16_t tmp = 0;
  uint8_t aRGB[4];
	uint8_t STATUS = SRAM_OK;
	static uint32_t counter = 0;
  uint8_t str[30];
	

	/* Format the string */
  sprintf((char *)str, "image_%lu.bmp", counter);  
  /* Create and Open a new file object with write access */
  if(f_open(&MyFile, (const char*)str, FA_CREATE_ALWAYS | FA_WRITE) != FR_OK) 
  {
    Error_Handler();
  }
  else
  {
		BSP_LCD_DisplayStringAt(0, 180, (uint8_t *)"Saving BMP file to USB", LEFT_MODE);
    /* Write data to the BMP file */
    res1 = f_write(&MyFile, (uint32_t *)aBMPHeader, 54, (void *)&byteswritten);
 	
		/* Go to the address of the last line of BMP file */
		address += ((BSP_LCD_GetXSize() * (BSP_LCD_GetYSize() - 1)) * 4);

		/* Read data from GRAM and swap it into SRAM */
		for(y = 0; y < (BSP_LCD_GetYSize()); y++)
		{ 
			for(x = 0; x < (BSP_LCD_GetXSize()); x++)
			{      
				/* Write data to heap, then to internal SRAM1 memory and lastly to bmp file. Returns uint16_t 16bits = 2 bytes for RGB565 */
				tmp  = BSP_LCD_ReadPixel(x, y); 
				
				aRGB[0] =  RGB565_TO_R(tmp);
				aRGB[1] =  RGB565_TO_G(tmp);
				aRGB[2] =  RGB565_TO_B(tmp);
				aRGB[3] =  0xFF;
				res2 = f_write(&MyFile, (uint16_t *)aRGB, (2*sizeof(uint32_t)), (void *)&byteswritten);
				//res2 = f_write(&MyFile, (uint16_t *)aRGB, (BSP_LCD_GetYSize()*BSP_LCD_GetXSize()*sizeof(uint32_t)), (void *)&byteswritten);
				/*pointer to volatile data SRAM1 112KBytes, must autoincerement the SRAM address and later the SRAM data value*/
				addr0 = address + x + 0;
				//SRAM_DATA = aRGB[0] ;
//				(*((volatile uint8_t*) addr0)) =  aRGB[0] ;
				addr1 = address + x + 1;
				//SRAM_DATA = aRGB[1] ;
//				(*((volatile uint8_t*) addr1)) =  aRGB[1] ;
				addr2 = address + x + 2;
				//SRAM_DATA = aRGB[2] ;
//				(*((volatile uint8_t*) addr2)) =  aRGB[2] ;
				//uint8_t BSP_SRAM_WriteData(uint32_t uwStartAddress, uint16_t *pData, uint32_t uwDataSize) 
				//      if(BSP_SRAM_WriteData(address, (uint16_t *)aRGB, 2) != SRAM_OK)				

			}
			address -= 8*BSP_LCD_GetXSize();
		}
	}		// end of else

		if((res1 != FR_OK) || (res2 != FR_OK) || (byteswritten == 0))
    {
      Error_Handler();
    }
    else
    {
      /* Close the open BMP file */
      f_close(&MyFile);
      
      /* Success of the demo: no error occurrence */
      BSP_LED_On(LED1);

      /* Wait for 2s */
      HAL_Delay(2000);

      counter++;
      BSP_LED_Off(LED1);
    }
	

	/* ...copy SRAM1 data (picture snapshot) to the LCD GRAM using  ili9325_WritePixel */	
	address = SRAM_DEVICE_ADDR;
	/* Go to the address of the last line of BMP file */
	address += ((BSP_LCD_GetXSize() * (BSP_LCD_GetYSize() - 1)) * 4);
 /* Read data from GRAM and swap it into SRAM */
	if(f_open(&MyFile, "house.bmp", FA_READ) == FR_OK)	
	{	
	BSP_LCD_DisplayStringAt(0, 200, (uint8_t *)"Opening house.BMP from USB", LEFT_MODE);
  for(y = 0; y < (BSP_LCD_GetYSize()); y++)
  { 
    for(x = 0; x < (BSP_LCD_GetXSize()); x++)
    {      
      /* Read BMP file and Write data to the SRAM memory */     
      res2 = f_read(&MyFile, (uint16_t *)aRGB, (2*sizeof(uint32_t)), (void *)&byteswritten);
 
      ili9325_WritePixel(x,y,aRGB[0]);   // This will overwrite existing picture!!!!!
      ili9325_WritePixel(x+1,y,aRGB[1]); // better save it on disk and reload it 
      ili9325_WritePixel(x+2,y,aRGB[2]);
  
    }
    address -= 8*BSP_LCD_GetXSize();
  }	
	}
	
	if((res1 != FR_OK) || (res2 != FR_OK) || (byteswritten == 0))
	{
		Error_Handler();
	}
	else
	{
		/* Close the open BMP file */
		f_close(&MyFile);
		
		/* Success of the demo: no error occurrence */
		BSP_LED_On(LED1);

		/* Wait for 2s */
		HAL_Delay(2000);

		BSP_LED_Off(LED1);
	}
	
	BSP_LCD_DrawRGBImage(0,0, 160, 120, myImage);	
	/* Wait for 2s */
  HAL_Delay(2000);
	return STATUS;
	
}

